import {BrowserRouter, HashRouter} from "react-router-dom";

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <HashRoute> 
  <React.StrictMode>

    <TodoApp />

  </React.StrictMode>
  </HashRoute> 
);

root.render(<TodoApp />);




